import { useState } from "react"

function App() {

    let [number , setNumber] = useState(0)
    const eventHandler = ()=>{
       setNumber(number + 1)
    }
    const eventHandlerOne = ()=>{
        setNumber(number - 1 )
    }
    return (
        <>
        <h2>{number}</h2>
        <button onClick={eventHandler}>increase</button>
        <button onClick={eventHandlerOne}>crease</button>
        </>
    )
}
export default App
